import "./App.css";
import { SimulationParamContainer } from "./SimulationParamContainer";
import styled from "styled-components";

function App() {
  return (
    <div className="App">
      <link rel="stylesheet" href="https://use.typekit.net/vut8tpq.css" />
      <Title>Tissue Designer</Title>
      <SimulationColumn>
        <SimulationTitle>Simulations</SimulationTitle>
        <SimulationParamContainer></SimulationParamContainer>
        <SimulationParamContainer></SimulationParamContainer>
        <SimulationParamContainer></SimulationParamContainer>
        <SimulationParamContainer></SimulationParamContainer>
        <CreateSimulationButton>Create Simulation +</CreateSimulationButton>
      </SimulationColumn>
    </div>
  );
}
const CreateSimulationButton = styled.button`
  border-radius: 25px;
  background: #89cff0;
  color: white;
  font-size: 38px;
  font-family: kallisto, sans-serif;
  font-weight: 200;
  font-style: bold;
  align-text: center;
  width: 60%;
  height: 65px;
`;
